import React from 'react';
import { Carousel, Container } from 'react-bootstrap';
import '../styles/CategoryButtons.css';
import parrot1 from '../images/birds/parrot1.jpg';
import parrot2 from '../images/birds/parrot2.jpeg';
import dog2 from '../images/dogs/dog2.jpg';
import greenarowana1 from '../images/fishes/greenarowana1.jpeg';
import dog3 from '../images/dogs/dog3.jpg';
import cat1 from '../images/cats/cat1.jpg'
import parrot3 from '../images/'


const CategoryButtons = () => {
  // Define CSS styles to control image size
  const imageStyle = {
    maxWidth: '100%', // Set maximum width
    maxHeight: '300px', // Set maximum height
    objectFit: 'cover', // Maintain aspect ratio and cover the container
  };

  return (
    <div className="main-banner-container">
      {/* Carousel 1 */}
      <Container className="carousel-container">
        <Carousel>
          <Carousel.Item>
            <img src={parrot1} alt="Parrot 1" style={imageStyle} className="carousel-image" />
          </Carousel.Item>
          <Carousel.Item>
            <img src={parrot2} alt="Parrot 2" style={imageStyle} className="carousel-image" />
          </Carousel.Item>
          {/* Add more items as needed */}
        </Carousel>
      </Container>

      {/* Carousel 2 */}
      <Container className="carousel-container">
        <Carousel>
          <Carousel.Item>
            <img src={dog2} alt="dog2" style={imageStyle} className="carousel-image" />
          </Carousel.Item>
          {/* Add more items as needed */}
        </Carousel>
      </Container>

      {/* Carousel 3 */}
      <Container className="carousel-container">
        <Carousel>
          <Carousel.Item>
            <img src={greenarowana1} alt="greenarowana1.jpeg" style={imageStyle} className="carousel-image" />
          </Carousel.Item>
          {/* Add more items as needed */}
        </Carousel>
      </Container>

      {/* Carousel 4 */}
      <Container className="carousel-container">
        <Carousel>
          <Carousel.Item>
            <img src={cat1} alt="cat1" style={imageStyle} className="carousel-image" />
          </Carousel.Item>
          {/* Add more items as needed */}
        </Carousel>
      </Container>
    </div>
  );
};

export default CategoryButtons;
